import React from 'react';

class FileManagement extends React.Component{
    constructor(props){
        super(props);
        this.onFileSelected = this.onFileSelected.bind(this);

        //Request file list to back-end
        //fetch("/files");

        this.state = {
            fileList: [
                "intan_save_210107_151441.rhs",
                "sample_0.rhs",
                "sample_1.rhs",
                "sample_2.rhs",
                "sample_3.rhs"],
        };
    }

    componentDidMount() {
    }

    onFileSelected (){
        var selected = document.getElementById("fileList").value;
        if (selected.length < 1)
            return;
        
        this.props.history.push('/viewer/' + selected);
    }

    render(){
        var containerStyle={
            width: '50vw'
        }

        var parentStyle={
            minWidth: '100vw',
            minHeight: '100vh',
            backgroundColor: '#282c34'
        }

        var selectStyle={
            width: '50vw',
            height: '80vh',
            backgroundColor: '#323741'
        }

        var options = [];
        for (var i = 0; i < this.state.fileList.length; i++){
             options.push(
                 <option key={i} value={this.state.fileList[i]}>{this.state.fileList[i]}</option>
             )
        }

        return (
        <div style={parentStyle}>
            <div className="container" style={containerStyle}>
                <div className='d-flex justify-content-end'>
                    <div>
                        <span>대충 이쯤에 로그인 정보</span>
                        </div>
                        <div>
                        <button className='btn btn-secondary'>Logout</button>
                    </div>
                </div>

                <div className='d-flex justify-content-center'>
                    <span>파이이이이ㅣㅣㅣ이이이ㅣ리ㅣ이이이ㅣㅣ이이ㅣ이이이이이이ㅣ이이ㅣㅣㄹ</span>
                </div>

                <div className='d-flex justify-content-center'>
                    <select id="fileList" className="form-select" style={selectStyle} onDoubleClick={this.onFileSelected} multiple>
                        {options}
                    </select>
                </div>

                <div className='d-flex justify-content-center'>
                    <button className='btn btn-primary' onClick={this.onFileSelected}>Open</button>
                    <button className='btn btn-secondary'>Rename</button>
                    <button className='btn btn-secondary'>Remove</button>
                    <button className='btn btn-secondary'>Upload</button>
                </div>
            </div>
        </div>);
    }
}

export default FileManagement;
